HQ very rare promo performance music video from a promo DVD. &quot;Don't Get Me Wrong&quot; is a song released by the pop-rock group The Pretenders. It was the first single taken from the group's 1986 album, Get Close. It can also be found on the band's The Singles album, released in 1987.

In the US, &quot;Don't Get Me Wrong&quot; became the group's second Top 10 hit on the Billboard Hot 100 chart, peaking at #10. Their first Top 10 pop hit, &quot;Back on the Chain Gang&quot;, had reached #5 in 1983. &quot;Don't Get Me Wrong&quot; also spent three weeks atop the Billboard Album Rock Tracks chart in November 1986. In the UK, the song also peaked at #10 in the UK Singles Chart.

Hynde stated in the VH1 Story Tellers series that she got the inspiration for the chorus' melody while on a British Airways flight. The airline's distinct &quot;tone&quot; jingle, which was played at certain times in the flight (for announcements from the pilot, seatbelt attention, etc.) had the same series of tones/notes as the chorus: DON'T- GET- ME- WRONG.

The song features a jangly guitar sound and an emphasis on melody. Hynde's lyrics contain literary and scientific references in addition to the more relationship-based subject matter typical for pop music. The song was covered by British pop singer Lily Allen for BBC Radio 1's 40th anniversary celebrations in 2007 and was released on the subsequent compilation album.

The Pretenders are an English-American rock band formed in Hereford, England, in March 1978. The original band comprised initiator and main songwriter Chrissie Hynde (lead vocals, rhythm guitar), James Honeyman-Scott (lead guitar, backing vocals, keyboards), Pete Farndon (bass guitar, backing vocals), and Martin Chambers (drums, backing vocals, percussion). Following the drug-related deaths of Honeyman-Scott and Farndon, the band has experienced numerous subsequent personnel changes, with Hynde as the only consistent member, and Chambers returning after an absence of several years.
